import React from 'react';

function Resume() {
    return (
        <section className="container">
            <h1 className="row justify-content-center">Resume</h1>
            <span className="row justify-content-center">Download my resume:</span>
            <a href="" className="row justify-content-center">Kalen Wiley - Resume</a>
            <h3>Front End Experience</h3>
            <h3>Back End Experience</h3>
        </section>
    )
}

export default Resume;
